import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import Survey from './App';
import { Router } from "react-router-dom";

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <Router>
    <Survey />
  </Router>
);
